Norton Rose Fulbright is a global legal practice. We provide the world's pre-eminent corporations and financial institutions with a full business law service. We have more than 4000 lawyers based in over 58 offices across Europe, the United States, Canada, Latin America, Asia, Australia, Africa, the Middle East and Central Asia.

Reporting to the Financial Systems & Operations Manager the Senior Financial Systems Analyst plays a critical role in the management, enhancement and ongoing optimisation of the firm‚Äôs financial management systems (Aderant Expert). This role ensures that finance related systems and reporting frameworks are robust, efficient and aligned with the business strategy.

Responsibilities

Management of practice management system

Responsible for managing the day-to-day support and the provision of technical expertise to facilitate the development and administration of the firm‚Äôs Financial Management System;
Co-ordinate the outsourcing of major project management system (PMS) related projects/tasks;
Serve as a liaison between Finance and IT to ensure system developments meet business and financial reporting requirements;
Collaborate with Database Administrators (DBAs) and IT teams to optimise SQL performance, data structure, and system integrations;
Assist the team in the development and delivery of financial solutions;

Operational reporting

Design, develop, and maintain high-quality financial reports, dashboards, and data extracts using SQL, SSRS, and other reporting tools
Provide support and technical advice in automating solutions that meet complex business requirements. This includes the system integration of key information sources i.e. FMS, CRM, Payroll, analytical reporting solutions (Reporting Services /Business Intelligent/SSAS) and developing ad-hoc SQL reporting requests and data extraction;
Work closely with key stakeholders to ensure all reporting content is accurate and captured in a timely manner;
Ensure data accuracy, completeness, and governance across reporting outputs and systems;
Manage, develop and maintain financial reporting solutions and ensure that the firm‚Äôs content management methodology follows best practice; and
Drive continuous improvement in financial reporting, data quality, and business intelligence tools.

Business analysis/Project Management

Lead and support projects related to finance systems, including scoping, requirements gathering, business case development, and implementation.
Liaise with stakeholders to effectively identify, analyse and document project business¬†requirements; work closely with Information Technology stakeholders to ensure the technical components of each project¬†are delivered in a satisfactory and timely manner;
Analyse complex business processes and identify opportunities for system or process improvements;
Design and develop efficient solutions based¬†on functional business requirements;
Undertake complex system reviews through SQL based data analysis i.e. mining and¬†modelling;
Perform other tasks, as required by your direct manager; and
Provide leave coverage where required.

Requirements

The successful candidate should be able to demonstrate:

Demonstrated experience within the professional services industry with a clear understanding of the day-to-day operations of the business, in particular, an understanding of the varying business models, service lines and cultures of a commercial law firm;
Advanced proficiency in Microsoft SQL Server, Excel, and financial modelling;
Strong analytical, problem-solving, and conceptual skills with a high attention to detail;
Demonstrated ability to translate business requirements into system solutions and technical specifications;
Proven ability to manage multiple priorities and deliver outcomes in high-pressure environments;
Excellent interpersonal skills with the ability to communicate complex information clearly to technical and non-technical audiences;
Familiarity with integrations between FMS, payroll, BI, or document management systems; and
Tertiary qualifications in IT and/or Finance would be an advantage;
Experience developing dashboards and reports using SSRS; knowledge of SSAS, Power BI or other BI tools; and
Experience with VBA, .NET, or other scripting languages (advantageous).

